def mergesort(lst):
    if len(lst) == 1:
        return lst
    elif len(lst) == 0:
        return lst
    else:
        x = int(len(lst) / 2)
        list_slice = lst[0:x]
        list_sliceII = lst[x:-1]
        u = mergesort(list_slice)
        p = mergesort(list_sliceII)
        ui = 0
        pi = 0
        l = []
    while ui < len(u) and pi < len(p):
        if u[ui] < p[pi]:
            l.append(u[ui])
            ui += 1
        else:
            l.append(p[pi])
            pi += 1
    if ui == len(u):
        while pi < len(p):
            l.append(p[pi])
            pi += 1
    else:
        while ui < len(u):
            l.append(u[ui])
            ui += 1
    return l
def fib(n):
    if n == 0:
        return 0
    elif n == 1:
        return 1
    if n in dict.keys():
        return dict[n]
    else:
        num = fib(n-1)
        num += fib(n-2)
        dict[n] = num
        return num
